import { BrowserRouter, Routes, Route } from "react-router-dom";
import { FrontPage } from "../Pages/Index";

function Router() {
  return (
    <BrowserRouter>
      <Routes>
        <Route path='="/' element={<FrontPage />}></Route>
      </Routes>
    </BrowserRouter>
  );
}

export default Router;
